Unprovoked?! This is a disgraceful statement from Defence Minister Richard Marles. It is also appalling that tonight the Opera House will be lit up in support of Israel - what about all of the Palestinian lives lost since occupation? What about the Palestinian Australian community mourning their loved ones? What about the decades upon decades of human rights violations against Palestinian people?

I am disgusted at both state and federal Labor Governments for their actions in relation to this. But also I guess we shouldn‚Äôt be surprised - because after all they too rule over a land still marked with the bloodstains of invasion and colonisation without any end to the injustice for First Nations people.

Today and every day, I stand in solidarity and defiance with Palestinian people here and across the globe. 

And urge you all to listen to the voices of Palestinian people - and human rights organisations - who are providing much needed perspective as well as  current historical context for the current escalation.

A statement issued by Al-Haq, Al Mezan Center for Human Rights, and the Palestinian Centre for Human Rights is calling on the Member States of the UN Security Council to:

1. Recognize and condemn Israel‚Äôs illegal occupation, settler-colonialism, and apartheid regime as the root causes underpinning the continuous waves of conflict in the territory;

2. Demand Israel‚Äôs immediate, unconditional and total withdrawal from the occupied Palestinian territory, as required in UN resolutions since 1967; 

3. Call for the dismantling of Israel‚Äôs settler colonial apartheid regime on both sides of the Green Line;

4. Take concrete steps to ensure the protection of the Palestinian people, particularly in the Gaza Strip, facing retaliatory Israeli attacks;

5. Sanction Israel‚Äôs illegal occupation, apartheid and acts of aggression through the application of an arms embargo, economic sanctions and countermeasures against Israel.

